    {
        await ChildService.RemoveHobbies(Int32.Parse(childId));
        myHobbies.Clear();
    }

    public async Task AddHobby()
    {
        if (myHobby == null || myHobby.HobbyType == "")
        {
            error = "The field is empty";
        }
        else
        {
